            <div class="text-container"><span class="t s0" style="left:203px;bottom:1413px;letter-spacing:0.3px;">PEMERINTAH KABUPATEN TANAH LAUT </span>
                <span class="t s0" style="left:273px;bottom:1375px;letter-spacing:0.32px;">KECAMATAN BUMI MAKMUR </span>
                <span class="t s1" style="left:282px;bottom:1329px;letter-spacing:-0.37px;">DESA HANDIL SURUK </span>
                <span class="t s2" style="left:132px;bottom:1300px;letter-spacing:-0.14px;word-spacing:0.01px;">Alamat Jl. Suka Damai Rt. 04 Rw. 02 Desa Handil Suruk Kec. Bumi Makmur Kode Pos 70853 </span>
                <span class="t s3" style="left:303px;bottom:1216px;letter-spacing:-0.13px;">SURAT KETERANGAN TIDAK MAMPU </span>
                <span class="t s4" style="left:292px;bottom:1187px;letter-spacing:-0.09px;">Nomor: </span><span class="t s4" style="left:356px;bottom:1187px;letter-spacing:-0.08px;word-spacing:0.06px;">400.9.14.5 / 43 </span><span class="t s4" style="left:482px;bottom:1187px;letter-spacing:-0.09px;">/HandilSuruk/2025 </span>
                <span class="t s4" style="left:87px;bottom:1129px;letter-spacing:-0.09px;">Yang bertanda tangan dibawah ini An. Kepala Desa Handil Suruk Kecamatan Bumi Makmur </span>
                <span class="t s4" style="left:87px;bottom:1100px;letter-spacing:-0.1px;">Kabupaten Tanah Laut, dengan ini menerangkan bahwa: </span>
                <span class="t s4" style="left:142px;bottom:1042px;letter-spacing:-0.13px;">Nama </span><span class="t s4" style="left:307px;bottom:1042px;letter-spacing:-0.1px;word-spacing:0.01px;">: NABILA </span>
                <span class="t s4" style="left:142px;bottom:998px;letter-spacing:-0.08px;">Bin/Binti </span><span class="t s4" style="left:307px;bottom:998px;letter-spacing:-0.11px;">: MAHYUNI </span>
                <span class="t s4" style="left:142px;bottom:954px;letter-spacing:-0.11px;">NIK </span><span class="t s4" style="left:307px;bottom:954px;letter-spacing:-0.1px;word-spacing:0.01px;">: 6301116306070003 </span>
                <span class="t s4" style="left:142px;bottom:909px;letter-spacing:-0.09px;">Tempat/Tgl. Lahir </span><span class="t s4" style="left:307px;bottom:909px;letter-spacing:-0.09px;">: Tanah Laut, 23-06-2007 </span>
                <span class="t s4" style="left:142px;bottom:865px;letter-spacing:-0.09px;">Jenis Kelamin </span><span class="t s4" style="left:307px;bottom:865px;letter-spacing:-0.1px;">: Perempuan </span>
                <span class="t s4" style="left:142px;bottom:821px;letter-spacing:-0.12px;">Agama </span><span class="t s4" style="left:307px;bottom:821px;letter-spacing:-0.08px;">: Islam </span>
                <span class="t s4" style="left:142px;bottom:777px;letter-spacing:-0.1px;">Pekerjaan </span><span class="t s4" style="left:307px;bottom:777px;letter-spacing:-0.09px;">: Pelajar/Mahasiswa </span>
                <span class="t s4" style="left:142px;bottom:732px;letter-spacing:-0.09px;">Alamat </span><span class="t s4" style="left:307px;bottom:732px;letter-spacing:-0.09px;">: Jl. Suka Damai Rt 05 Rw 02 Desa Handil Suruk </span>
                <span class="t s4" style="left:316px;bottom:688px;letter-spacing:-0.09px;">Kec. Bumi Makmur Kab. Tanah Laut </span>
                <span class="t s4" style="left:87px;bottom:615px;letter-spacing:0.1px;word-spacing:1.32px;">Sepengatahuan kami yang bersangkutan bertempat tinggal didesa kami adalah benar keadaan </span>
                <span class="t s4" style="left:87px;bottom:586px;letter-spacing:0.04px;word-spacing:1.78px;">penghidupan termasuk keluarga </span><span class="t s3" style="left:343px;bottom:586px;letter-spacing:0.04px;word-spacing:1.73px;">KURANG MAMPU</span><span class="t s4" style="left:489px;bottom:586px;letter-spacing:0.22px;word-spacing:1.6px;">, adapun surat keterangan ini dibuat untuk </span>
                <span class="t s4" style="left:87px;bottom:557px;letter-spacing:-0.09px;">keperluan melengkapi persyaratan </span><span class="t s3" style="left:349px;bottom:557px;letter-spacing:-0.1px;">untuk Administrasi Pengurusan Beasiswa. </span>
                <span class="t s4" style="left:87px;bottom:513px;letter-spacing:-0.09px;">Demikian Surat Keterangan ini diberikan untuk dipergunakan sebagaimana mestinya. </span>
                <span class="t s4" style="left:454px;bottom:424px;letter-spacing:-0.09px;word-spacing:0.07px;">Handil Suruk, 24 Maret </span><span class="t s4" style="left:635px;bottom:424px;letter-spacing:-0.11px;">2025 </span>
                <span class="t s4" style="left:449px;bottom:396px;letter-spacing:-0.09px;">An. Kepala Desa Handil Suruk </span>
                <span class="t s3" style="left:495px;bottom:251px;letter-spacing:-0.13px;">RAHMAD DOA </span>
            </div>

        </div>

    </div>

    <script>
        const metadata = JSON.parse(document.getElementById("metadata").text);
        document.title = metadata.title || metadata.fileName;

        const annotations = JSON.parse(document.getElementById("annotations").text);
        const pages = document.querySelectorAll(".page");

        const createAnnotation = function(container, data, pageNo) {
            if (data.type !== "Link" && data.type !== "TextLink") {
                return;
            }
            if (!data.action) {
                return;
            }

            const annotation = document.createElement("div");
            annotation.setAttribute("style", "");
            annotation.style.left = data.bounds[0] + "px";
            annotation.style.top = data.bounds[1] + "px";
            annotation.style.width = data.bounds[2] + "px";
            annotation.style.height = data.bounds[3] + "px";
            annotation.dataset.type = data.type;
            if (data.objref) {
                annotation.dataset.objref = data.objref;
            }

            if (data.appearance) {
                annotation.style.backgroundImage = "url('" + data.appearance + "')";
                annotation.style.backgroundSize = "100% 100%";
            }

            if (data.action.type === "URI") {
                const element = document.createElement("a");
                element.href = data.action.uri;
                element.title = data.action.uri;
                element.target = "_blank";
                element.style.position = "absolute";
                element.style.width = "100%";
                element.style.height = "100%";
                annotation.appendChild(element);
            } else {
                annotation.addEventListener("click", () => {
                    switch (data.action.type) {
                        case "GoTo":
                            pages[data.action.page - 1].scrollIntoView();
                            break;

                        case "Named":
                            switch (data.action.name) {
                                case "NextPage":
                                    pages[pageNo - 2].scrollIntoView();
                                    break;
                                case "PrevPage":
                                    pages[pageNo].scrollIntoView();
                                    break;
                                case "FirstPage":
                                    pages[0].scrollIntoView();
                                    break;
                                case "LastPage":
                                    pages[metadata.pagecount - 1].scrollIntoView();
                                    break;
                            }
                            break;
                    }
                });
            }
            container.append(annotation);
        };

        annotations.pages.forEach(pageAnnotations => {
            const pageNo = pageAnnotations.page;
            const annotationsContainer = document.createElement("div");
            annotationsContainer.className = "annotations-container";
            annotationsContainer.style.width = metadata.bounds[pageNo - 1][0];
            annotationsContainer.style.height = metadata.bounds[pageNo - 1][1];
            pageAnnotations.annotations.forEach(annotation => createAnnotation(annotationsContainer, annotation, pageNo));
            pages[pageNo - 1].firstElementChild.appendChild(annotationsContainer);
        });
    </script>
